        var self = this;
        var text = self.messagebar.getValue().replace(/\n/g, '<br>').trim();
        var messagesToSend = [];
        self.attachments.forEach(function (attachment) {
          messagesToSend.push({
            image: attachment,
          });
        });
        if (text.trim().length) {
          messagesToSend.push({
            text: text,
          });
        }
        // Reset attachments
        self.attachments = [];
        // Hide sheet
        self.sheetVisible = false;
        // Clear area
        self.messagebar.clear();
        // Focus area
        if (text.length) { self.messagebar.focus(); }
        // Send message
        (ref = self.messagesData).push.apply(ref, messagesToSend);

        // Mock response
        if (self.responseInProgress) { return; }
        self.responseInProgress = true;
        setTimeout(function () {
          var answer = self.answers[Math.floor(Math.random() * self.answers.length)];
          var person = self.people[Math.floor(Math.random() * self.people.length)];
          self.typingMessage = {
            name: person.name,
            avatar: person.avatar,
          };
          setTimeout(function () {
            self.messagesData.push({
              text: answer,
              type: 'received',
              name: person.name,
              avatar: person.avatar,
            });
            self.typingMessage = null;
            self.responseInProgress = false;
          }, 4000);
        }, 1000);
